import React from 'react'
import axios from 'axios'

class Compare extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apikey: this.props.apikey, date: this.props.date, result: ''};
    }
    getBrands() {
        axios({
            method: 'post',
            headers: "Content-Type: application/json",
            url: 'http://localhost:3001/requests',
            data: JSON.stringify({"apikey":this.state.apikey,"method":"partner_api.get_brands","params":{"projectname":"Automotive"}})
          })
          .then(response => {
              console.log(response.data);
          });
