        // fetch("http://localhost:3001/requests", requestOptions)
        // .then((response) => this.state.result = response.text())
        // .then((data) => console.log('This is your data', data));
    }
    render() {
        return (
            <div>
                <button className="btn btn-primary mt-5"
                        type="submit"
                        onChange={this.getBrands}
                        onSubmit={this.getBrands}>Get data</button>
                <h3>Result: {this.response}</h3>
            </div>
        )
    }
}

export default Compare;

